"A glycosylglucose consisting of two D-glucopyranose units connected by an alpha-(1->4)-linkage [ChEBI]. A dextrodisaccharide from malt and starch. It is used as a sweetening agent and fermentable intermediate in brewing. (Grant & Hackh's Chemical Dictionary, 5th ed) [MeSH].", 
"An alpha-D-glucoside consisting of D-glucitol having an alpha-D-glucosyl residue attached at the 4-position. Used as a sugar substitute [ChEBI].", 
"A tetrasaccharide consisting of sucrose having an alpha-D-galactosyl-(1->6)-alpha-D-galactosyl moiety attached at the 6-position of the glucose [ChEBI].", 
"A trehalose in which both glucose residues have alpha-configuration at the anomeric carbon [ChEBI].", 
"A trehalose in which both glucose residues have alpha-configuration at the anomeric carbon [ChEBI].", 
"Sucrose is a disaccharide formed by glucose and fructose units joined by an acetal oxygen bridge from hemiacetal of glucose to the hemiketal of the fructose [ChEBI]. A nonreducing disaccharide composed of GLUCOSE and FRUCTOSE linked via their anomeric carbons. It is obtained commercially from SUGARCANE, sugar beet (BETA VULGARIS), and other plants and used extensively as a food and a sweetener [MeSH].", 
"A glycosylglucose formed by an alpha-(1->6)-linkage between D-galactose and D-glucose [ChEBI]. A disaccharide consisting of one galactose and one glucose moiety in an alpha (1-6) glycosidic linkage [MeSH].", 
"A synthetic galactosylfructose disaccharide used in the treatment of constipation and hepatic encephalopathy [ChEBI]. A synthetic disaccharide used in the treatment of constipation and hepatic encephalopathy. It has also been used in the diagnosis of gastrointestinal disorders. (From Martindale, The Extra Pharmacopoeia, 30th ed, p887) [MeSH].", 
NA, "A disaccharide, found most notably in milk, that consists of D-galactose and D-glucose fragments bonded through a beta-1->4 glycosidic linkage. The glucose fragment can be in either the alpha- or beta-pyranose form, whereas the galactose fragment can only have the beta-pyranose form [ChEBI]. A disaccharide of GLUCOSE and GALACTOSE in human and cow milk. It is used in pharmacy for tablets, in medicine as a nutrient, and in industry [MeSH].", 
"The D-enantiomer of N-acetylgalactosamine [ChEBI]. The N-acetyl derivative of galactosamine [MeSH].", 
"The pyranose form of N-acetyl-D-glucosamine [ChEBI]. The N-acetyl derivative of glucosamine [MeSH].", 
"3,6-Diamino-10-methylacridinium chloride mixt. with 3,6-acridinediamine. Fluorescent dye used as a local antiseptic and also as a biological stain. It intercalates into nucleic acids thereby inhibiting bacterial and viral replication [MeSH].", 
"An antibiotic produced by Streptomyces spectabilis. It is active against gram-negative bacteria and used for the treatment of gonorrhea [MeSH].", 
"The parent compound of the 6-aminopurines, composed of a purine having an amino group at C-6 [ChEBI]. A purine base and a fundamental unit of ADENINE NUCLEOTIDES [MeSH].", 
"A ribonucleoside composed of a molecule of adenine attached to a ribofuranose moiety via a beta-N(9)-glycosidic bond [ChEBI]. A nucleoside that is composed of adenine and d-ribose. Adenosine or adenosine derivatives play many important biological roles in addition to being components of DNA and RNA. Adenosine itself is a neurotransmitter [MeSH].", 
