"A pregnane-based steroidal hormone produced by the outer-section (zona glomerulosa) of the adrenal cortex in the adrenal gland, and acts on the distal tubules and collecting ducts of the kidney to cause the conservation of sodium, secretion of potassium, increased water retention, and increased blood pressure. The overall effect of aldosterone is to increase reabsorption of ions and water in the kidney [ChEBI]. A hormone secreted by the ADRENAL CORTEX that regulates electrolyte and water balance by increasing the renal retention of sodium and the excretion of potassium [MeSH].", 
"An imidazolidine-2,4-dione that is 5-aminohydantoin in which a carbamoyl group is attached to the exocyclic nitrogen [ChEBI]. A urea hydantoin that is found in URINE and PLANTS and is used in dermatological preparations [MeSH].", 
NA, "A broad-spectrum antibiotic derived from KANAMYCIN. It is reno- and oto-toxic like the other aminoglycoside antibiotics [MeSH].", 
"A highly fluorescent anti-infective dye used clinically as a topical antiseptic and experimentally as a mutagen, due to its interaction with DNA. It is also used as an intracellular pH indicator [MeSH].", 
"The simplest delta-amino acid in which the hydrogens at the gamma position are replaced by an oxo group [ChEBI]. A compound produced from succinyl-CoA and GLYCINE as an intermediate in heme synthesis. It is used as a PHOTOCHEMOTHERAPY for actinic KERATOSIS [MeSH].", 
"A folic acid derivative used as a rodenticide that has been shown to be teratogenic [MeSH].", 
"Tricyclic antidepressant with anticholinergic and sedative properties. It appears to prevent the re-uptake of norepinephrine and serotonin at nerve terminals, thus potentiating the action of these neurotransmitters. Amitriptyline also appears to antagonize cholinergic and alpha-1 adrenergic responses to bioactive amines [MeSH].", 
"A non-selective post-emergence, translocated herbicide. According to the Seventh Annual Report on Carcinogens (PB95-109781, 1994) this substance may reasonably be anticipated to be a carcinogen. (From Merck Index, 12th ed) It is an irreversible inhibitor of CATALASE, and thus impairs activity of peroxisomes [MeSH].", 
"An azane that consists of a single nitrogen atom covelently bonded to three hydrogen atoms [ChEBI]. Ammonia. A colorless alkaline gas. It is formed in the body during decomposition of organic materials during a large number of metabolically important reactions [MeSH].", 
"An acidifying agent that has expectorant and diuretic effects. Also used in etching and batteries and as a flux in electroplating [MeSH].", 
"A penicillin in which the substituent at position 6 of the penam ring is a 2-amino-2-(4-hydroxyphenyl)acetamido group [ChEBI]. A broad-spectrum semisynthetic antibiotic similar to AMPICILLIN except that its resistance to gastric acid permits higher serum levels with oral administration [MeSH].", 
"A penicillin in which the substituent at position 6 of the penam ring is a 2-amino-2-phenylacetamido group [ChEBI]. Semi-synthetic derivative of penicillin that functions as an orally active broad-spectrum antibiotic [MeSH].", 
"A cyanogenic glycoside found in the seeds of Rosaceae [MeSH].", 
