"Conjugate acid of atropine arising from protonation of the tertiary amino group; major species at pH 7.3 [ChEBI]. An alkaloid, originally from Atropa belladonna, but found in other plants, mainly SOLANACEAE [MeSH].", 
"A pyrimidine analogue that inhibits DNA methyltransferase, impairing DNA methylation. It is also an antimetabolite of cytidine, incorporated primarily into RNA. Azacytidine has been used as an antineoplastic agent [MeSH].", 
"Antibiotic substance produced by various Streptomyces species. It is an inhibitor of enzymatic activities that involve glutamine and is used as an antineoplastic and immunosuppressive agent [MeSH].", 
"An immunosuppressive agent used in combination with cyclophosphamide and hydroxychloroquine in the treatment of rheumatoid arthritis. According to the Fourth Annual Report on Carcinogens (NTP 85-002, 1985), this substance has been listed as a known carcinogen. (Merck Index, 11th ed) [MeSH].", 
"A semisynthetic penicillin antibiotic used in treating infections caused by Pseudomonas aeruginosa, Escherichia coli, and Haemophilus influenzae [ChEBI]. A semisynthetic ampicillin-derived acylureido penicillin [MeSH].", 
"A synthetic monocyclic beta-lactam antibiotic (monobactam) [ChEBI]. A monocyclic beta-lactam antibiotic originally isolated from Chromobacterium violaceum. It is resistant to beta-lactamases and is used in gram-negative infections, especially of the meninges, bladder, and kidneys. It may cause a superinfection with gram-positive organisms [MeSH].", 
"A carbohydrazide that results from the formal condensation of the carboxy group of DL-serine with the primary amino group of 4-(hydrazinylmethyl)benzene-1,2,3-triol. An aromatic-L-amino-acid decarboxylase inhibitor (DOPA decarboxylase inhibitor) that does not enter the central nervous system, it is used as its hydrochloride salt as an adjunct to levodopa in the treatment of parkinsonism. By preventing the conversion of levodopa to dopamine in the periphery, it causes an increase in the amount of levodopa reaching the central nervous system and so reduces the required dose. Benserazide has no antiparkinson actions when given alone [ChEBI]. An inhibitor of DOPA DECARBOXYLASE that does not enter the central nervous system. It is often given with LEVODOPA in the treatment of parkinsonism to prevent the conversion of levodopa to dopamine in the periphery, thereby increasing the amount that reaches the central nervous system and reducing the required dose. It has no antiparkinson actions when given alone [MeSH].", 
"Bactericidal cationic quaternary ammonium surfactant used as a topical anti-infective agent. It is an ingredient in medicaments, deodorants, mouthwashes, etc., and is used to disinfect apparatus, etc., in the food processing and pharmaceutical industries, in surgery, and also as a preservative. The compound is toxic orally as a result of neuromuscular blockade [MeSH].", 
"The amino acid betaine derived from glycine [ChEBI]. A naturally occurring compound that has been of interest for its role in osmoregulation. As a drug, betaine hydrochloride has been used as a source of hydrochloric acid in the treatment of hypochlorhydria. Betaine has also been used in the treatment of liver disorders, for hyperkalemia, for homocystinuria, and for gastrointestinal disturbances. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1341) [MeSH].", 
"An organic heterobicyclic compound that consists of 2-oxohexahydro-1H-thieno[3,4-d]imidazole having a valeric acid substituent attached to the tetrahydrothiophene ring. The parent of the class of biotins [ChEBI]. A water-soluble, enzyme co-factor present in minute amounts in every living cell. It occurs mainly bound to proteins or polypeptides and is abundant in liver, kidney, pancreas, yeast, and milk [MeSH].", 
"A compound formed by the condensation of two molecules of urea; the parent compound of the biuret group of compounds. Used as a non-protein nitrogen source in ruminant feed [ChEBI]. Used as feed supplement for sheep and cattle since it is a good non-protein nitrogen source. In strongly alkaline solution biuret gives a violet color with copper sulfate [MeSH].", 
"A glycopeptide antibiotic produced by the bacterium Streptomyces verticillus. The term, 'bleomycin' refers to a family of structurally related compounds. When used as an anti-cancer agent, the chemotherapeutical forms are primarily bleomycin A2 and B2 [ChEBI]. A complex of related glycopeptide antibiotics from Streptomyces verticillus consisting of bleomycin A2 and B2. It inhibits DNA metabolism and is used as an antineoplastic, especially for solid tumors [MeSH].", 
"A methanesulfonate ester that is butane-1,4-diol in which the hydrogens of the hydroxy groups are replaced by methanesulfonyl groups. An alkylating antineoplastic agent, it is used for the treatment of chronic myeloid leukemia (although it has been largely replaced by newer drugs). It is also used as an insect sterilant [ChEBI]. An alkylating agent having a selective immunosuppressive effect on BONE MARROW. It has been used in the palliative treatment of chronic myeloid leukemia (MYELOID LEUKEMIA, CHRONIC), but although symptomatic relief is provided, no permanent remission is brought about. According to the Fourth Annual Report on Carcinogens (NTP 85-002, 1985), busulfan is listed as a known carcinogen [MeSH].", 
"A straight-chain pentane core with amino substitutents at positions 1 and 5. A colourless syrupy liquid diamine with a distinctive unpleasant odour, it is a homologue of putresceine and is formed by the bacterial decarboxylation of lysine that occurs during protein hydrolysis during putrefaction of animal tissue [ChEBI]. A foul-smelling diamine formed by bacterial decarboxylation of lysine [MeSH].", 
"A trimethylxanthine in which the three methyl groups are located at positions 1, 3, and 7 [ChEBI]. A methylxanthine naturally occurring in some beverages and also used as a pharmacological agent. Caffeine's most notable pharmacological effect is as a central nervous system stimulant, increasing alertness and producing agitation. It also relaxes SMOOTH MUSCLE, stimulates CARDIAC MUSCLE, stimulates DIURESIS, and appears to be useful in the treatment of some types of headache. Several cellular actions of caffeine have been observed, but it is not entirely clear how each contributes to its pharmacological profile. Among the most important are inhibition of cyclic nucleotide PHOSPHODIESTERASES, antagonism of ADENOSINE RECEPTORS, and modulation of intracellular calcium handling [MeSH].", 
"A 32-membered heterodetic cyclic peptide comprising the sequence Cys-Ser-Asn-Leu-Ser-Thr-Cys-Val-Leu-Gly-Lys-Leu-Ser-Gln-Glu-Leu-His-Lys-Leu-Gln-Thr-Tyr-Pro-Arg-Thr-Asn-Thr-Gly-Ser-Gly-Thr-Pro-NH2 cyclised by a disulfide bridge between the two Cys residues at positions 1 and 7 [ChEBI]. A peptide hormone that lowers calcium concentration in the blood. In humans, it is released by thyroid cells and acts to decrease the formation and absorptive activity of osteoclasts. Its role in regulating plasma calcium is much greater in children and in certain diseases than in normal adults [MeSH].", 
"A salt used to replenish calcium levels, as an acid-producing diuretic, and as an antidote for magnesium poisoning [MeSH].", 
"An alkaloid isolated from the stem wood of the Chinese tree, Camptotheca acuminata. This compound selectively inhibits the nuclear enzyme DNA TOPOISOMERASES, TYPE I. Several semisynthetic analogs of camptothecin have demonstrated antitumor activity [MeSH].", 
"Cyclic peptide antibiotic similar to VIOMYCIN. It is produced by Streptomyces capreolus [MeSH].", 
"A C6, straight-chain saturated fatty acid [ChEBI]. Derivatives of caproic acid. Included under this heading are a broad variety of acid forms, salts, esters, and amides that contain a carboxy terminated six carbon aliphatic structure [MeSH].", 
"One of the phthalimide fungicides [MeSH].", "The monoanhydride of carbamic acid with PHOSPHORIC ACID. It is an important intermediate metabolite and is synthesized enzymatically by CARBAMYL-PHOSPHATE SYNTHASE (AMMONIA) and CARBAMOYL-PHOSPHATE SYNTHASE (GLUTAMINE-HYDROLYZING) [MeSH].", 
"A penicillin antibiotic having a 6beta-2-carboxy-2-phenylacetamido side chain [ChEBI]. Broad-spectrum semisynthetic penicillin derivative used parenterally. It is susceptible to gastric juice and penicillinase and may damage platelet function [MeSH].", 
"A proton ionophore. It is commonly used as an uncoupling agent and inhibitor of photosynthesis because of its effects on mitochondrial and chloroplast membranes [MeSH].", 
"A proton ionophore that is commonly used as an uncoupling agent in biochemical studies [MeSH].", 
"A cell-cycle phase nonspecific alkylating antineoplastic agent. It is used in the treatment of brain tumors and various other malignant neoplasms. (From Martindale, The Extra Pharmacopoeia, 30th ed, p462) This substance may reasonably be anticipated to be a carcinogen according to the Fourth Annual Report on Carcinogens (NTP 85-002, 1985). (From Merck Index, 11th ed) [MeSH].", 
"An amino-acid betaine that is butanoate substituted with a hydroxy group at position C-3 and a trimethylammonium group at C-4 [ChEBI]. Constituent of striated muscle and liver. It is used therapeutically to stimulate gastric and pancreatic secretions and in the treatment of hyperlipoproteinemias [MeSH].", 
"Constituent of striated muscle and liver. It is used therapeutically to stimulate gastric and pancreatic secretions and in the treatment of hyperlipoproteinemias [MeSH].", 
"A cephalosporin prodrug having (R)-O-formylmandelamido and N-methylthiotetrazole side groups [ChEBI]. Semisynthetic wide-spectrum cephalosporin with prolonged action, probably due to beta-lactamase resistance. It is used also as the nafate [MeSH].", 
"A cephalosporin compound having [(5-methyl-1,3,4-thiadiazol-2-yl)sulfanyl]methyl and (1H-tetrazol-1-ylacetyl)amino side groups [ChEBI]. A semisynthetic cephalosporin analog with broad-spectrum antibiotic action due to inhibition of bacterial cell wall synthesis. It attains high serum levels and is excreted quickly via the urine [MeSH].", 
"A semi-synthetic parenteral cephalosporin with a tetrazolyl moiety that confers beta-lactamase resistance [ChEBI]. Semisynthetic broad-spectrum cephalosporin with a tetrazolyl moiety that is resistant to beta-lactamase. It has been proposed especially against Pseudomonas infections [MeSH].", 
"A cephalosporin compound having acetoxymethyl and [2-(2-amino-1,3-thiazol-4-yl)-2-(methoxyimino)acetyl]amino side groups [ChEBI]. Semisynthetic broad-spectrum cephalosporin [MeSH].", 
"A semisynthetic cephamycin antibiotic which, in addition to the methoxy group at the 7alpha position, has 2-thienylacetamido and carbamoyloxymethyl side groups. It is resistant to beta-lactamase [ChEBI]. A semisynthetic cephamycin antibiotic resistant to beta-lactamase [MeSH].", 
"A pyridinium-substituted semi-synthetic, broad-spectrum, cephalosporin antibiotic [ChEBI]. A pyridinium-substituted semisynthetic, broad-spectrum antibacterial used especially for Pseudomonas infections in debilitated patients [MeSH].", 
"A cephalosporin compound having 2-(2-amino-1,3-thiazol-4-yl)-2-(methoxyimino)acetylamino and [(2-methyl-5,6-dioxo-1,2,5,6-tetrahydro-1,2,4-triazin-3-yl)sulfanyl]methyl side groups [ChEBI]. A broad-spectrum cephalosporin antibiotic with a very long half-life and high penetrability to meninges, eyes and inner ears [MeSH].", 
"A 3-(carbamoyloxymethyl)cephalosporin compound having a 7-(2Z)-2-(furan-2-yl)-2-(methoxyimino)acetamido side chain [ChEBI]. Broad-spectrum cephalosporin antibiotic resistant to beta-lactamase. It has been proposed for infections with gram-negative and gram-positive organisms, GONORRHEA, and HAEMOPHILUS [MeSH].", 
"A disaccharide consisting of two glucose units in beta (1-4) glycosidic linkage. Obtained from the partial hydrolysis of cellulose [MeSH].", 
"A semisynthetic, first-generation cephalosporin antibiotic with acetoxymethyl and (2-thienylacetyl)nitrilo moieties at positions 3 and 7, respectively, of the core structure. Administered parenterally during surgery and to treat a wide spectrum of blood infections [ChEBI]. A cephalosporin antibiotic [MeSH].", 
"Cationic bactericidal surfactant used as a topical antiseptic for skin, wounds, mucous membranes, instruments, etc.; and also as a component in mouthwash and lozenges [MeSH].", 
"A nitrogen mustard alkylating agent used as antineoplastic for chronic lymphocytic leukemia, Hodgkin's disease, and others. Although it is less toxic than most other nitrogen mustards, it has been listed as a known carcinogen in the Fourth Annual Report on Carcinogens (NTP 85-002, 1985). (Merck Index, 11th ed) [MeSH].", 
"A dichloro-substituted acetamide containing a nitrobenzene ring, an amide bond and two alcohol functions [ChEBI]. An antibiotic first isolated from cultures of Streptomyces venequelae in 1947 but now produced synthetically. It has a relatively simple structure and was the first broad-spectrum antibiotic to be discovered. It acts by interfering with bacterial protein synthesis and is mainly bacteriostatic. (From Martindale, The Extra Pharmacopoeia, 29th ed, p106) [MeSH].", 
"A bisbiguanide compound with a structure consisting of two (p-chlorophenyl)guanide units linked by a hexamethylene bridge [ChEBI]. A disinfectant and topical anti-infective agent used also as mouthwash to prevent oral plaque [MeSH].", 
"A substituted phenothiazine in which the ring nitrogen at position 10 is attached to C-3 of an N,N-dimethylpropanamine moiety [ChEBI]. The prototypical phenothiazine antipsychotic drug. Like the other drugs in this class chlorpromazine's antipsychotic actions are thought to be due to long-term adaptation by the brain to blocking DOPAMINE RECEPTORS. Chlorpromazine has several other actions and therapeutic uses, including as an antiemetic and in the treatment of intractable hiccup [MeSH].", 
"A TETRACYCLINE with a 7-chloro substitution [MeSH].", "A choline that is the parent compound of the cholines class, consisting of ethanolamine having three methyl substituents attached to the amino function [ChEBI]. A basic constituent of lecithin that is found in many plants and animal organs. It is important as a precursor of acetylcholine, as a methyl donor in various metabolic processes, and in lipid metabolism [MeSH].", 
"A choline that is the parent compound of the cholines class, consisting of ethanolamine having three methyl substituents attached to the amino function [ChEBI]. A basic constituent of lecithin that is found in many plants and animal organs. It is important as a precursor of acetylcholine, as a methyl donor in various metabolic processes, and in lipid metabolism [MeSH].", 
"A chondroitin sulfate in which the site of sulfation is carbon 6 of the N-acetylgalactosamine (GalNAc) sugar [ChEBI]. Derivatives of chondroitin which have a sulfate moiety esterified to the galactosamine moiety of chondroitin. Chondroitin sulfate A, or chondroitin 4-sulfate, and chondroitin sulfate C, or chondroitin 6-sulfate, have the sulfate esterified in the 4- and 6-positions, respectively. Chondroitin sulfate B (beta heparin; DERMATAN SULFATE) is a misnomer and this compound is not a true chondroitin sulfate [MeSH].", 
"A cyclohexadiene carboxylic acid derived from SHIKIMIC ACID and a precursor for the biosynthesis of UBIQUINONE and the AROMATIC AMINO ACIDS [MeSH].", 
"6,7-Methylenedioxycinnolin-4(1H)-one bearing an ethyl group at position 1 and a carboxylic acid group at position 3. An analogue of oxolinic acid, it has similar antibacterial actions. It was formerly used for the treatment of urinary tract infections [ChEBI]. Synthetic antimicrobial related to OXOLINIC ACID and NALIDIXIC ACID and used in URINARY TRACT INFECTIONS [MeSH].", 
"Quinolin-4(1H)-one bearing cyclopropyl, carboxylic acid, fluoro and piperazin-1-yl substituents at positions 1, 3, 6 and 7, respectively [ChEBI]. A broad-spectrum antimicrobial carboxyfluoroquinoline [MeSH].", 
"A platinum-containing anticancer drug that interacts with, and forms cross-links between, DNA and proteins. It is used as a neoplasm inhibitor to treat solid tumours, primarily of the testis and ovary [ChEBI]. An inorganic and water-soluble platinum complex. After undergoing hydrolysis, it reacts with DNA to produce both intra and interstrand crosslinks. These crosslinks appear to impair replication and transcription of DNA. The cytotoxicity of cisplatin correlates with cellular arrest in the G2 phase of the cell cycle [MeSH].", 
"The L-enantiomer of citrulline [ChEBI].", "The L-enantiomer of citrulline [ChEBI].", 
"A semisynthetic penicillin antibiotic carrying a 3-(2-chlorophenyl)-5-methylisoxazole-4-carboxamido group at position 6 [ChEBI]. A semi-synthetic antibiotic that is a chlorinated derivative of OXACILLIN [MeSH].", 
"A carbotricyclic compound comprising 5,6,7,9-tetrahydrobenzo[a]heptalene having four methoxy substituents at the 1-, 2-, 3- and 10-positions as well as an oxo group at the 9-position and an acetamido group at the 7-position [ChEBI]. A major alkaloid from Colchicum autumnale L. and found also in other Colchicum species. Its primary therapeutic use is in the treatment of gout, but it has been used also in the therapy of familial Mediterranean fever (PERIODIC DISEASE) [MeSH].", 
"A multi-component mixture comprising mostly of colistin A (R = Me) and B (R = H), with small amounts of colistin C and other polymyxins, produced by certain strains of Bacillus polymyxa var. colistinus. An antibiotic, it is used as its sulfate salt (for oral or topical use) or as the sodium salt of the N-methylsulfonic acid derivative (the injectable form) in the treatment of severe Gram-negative infections, partiularly those due to Pseudomonas aeruginosa [ChEBI]. Cyclic polypeptide antibiotic from Bacillus colistinus. It is composed of Polymyxins E1 and E2 (or Colistins A, B, and C) which act as detergents on cell membranes. Colistin is less toxic than Polymyxin B, but otherwise similar; the methanesulfonate is used orally [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"A lactam obtained by formal cyclocondensation of creatine [ChEBI].", 
"Antibiotic substance isolated from streptomycin-producing strains of Streptomyces griseus. It acts by inhibiting elongation during protein synthesis [MeSH].", 
"Antibiotic substance produced by Streptomyces garyphalus [MeSH].", 
"A modified amino acid generated by enzymic means from homocysteine and serine [ChEBI].", 
"An ethane skeleton substituted with a thiol group at C-1 and an amino group at C-2 [ChEBI]. A radiation-protective agent that oxidizes in air to form CYSTAMINE. It can be given intravenously or orally to treat radiation sickness. The bitartrate has been used for the oral treatment of nephropathic cystinosis [MeSH].", 
"The L-enantiomer of cysteic acid [ChEBI]. Beta-Sulfoalanine. An amino acid with a C-terminal sulfonic acid group which has been isolated from human hair oxidized with permanganate. It occurs normally in the outer part of the sheep's fleece, where the wool is exposed to light and weather [MeSH].", 
"The L-enantiomer of cysteic acid [ChEBI]. Beta-Sulfoalanine. An amino acid with a C-terminal sulfonic acid group which has been isolated from human hair oxidized with permanganate. It occurs normally in the outer part of the sheep's fleece, where the wool is exposed to light and weather [MeSH].", 
"An optically active form of cysteine having L-configuration [ChEBI]. A thiol-containing non-essential amino acid that is oxidized to form CYSTINE [MeSH].", 
"An optically active form of cysteine having D-configuration [ChEBI]. A thiol-containing non-essential amino acid that is oxidized to form CYSTINE [MeSH].", 
"A pyrimidine nucleoside analog that is used mainly in the treatment of leukemia, especially acute non-lymphoblastic leukemia. Cytarabine is an antimetabolite antineoplastic agent that inhibits the synthesis of DNA. Its actions are specific for the S phase of the cell cycle. It also has antiviral and immunosuppressant properties. (From Martindale, The Extra Pharmacopoeia, 30th ed, p472) [MeSH].", 
"A pyrimidine nucleoside in which cytosine is attached to ribofuranose via a beta-N(1)-glycosidic bond [ChEBI]. A pyrimidine nucleoside that is composed of the base CYTOSINE linked to the five-carbon sugar D-RIBOSE [MeSH].", 
"An aminopyrimidine that is pyrimidin-2-one having the amino group located at position 4 [ChEBI]. A pyrimidine base that is a fundamental unit of nucleic acids [MeSH].", 
"A compound composed of a two CYCLIC PEPTIDES attached to a phenoxazine that is derived from STREPTOMYCES parvullus. It binds to DNA and inhibits RNA synthesis (transcription), with chain elongation more sensitive than initiation, termination, or release. As a result of impaired mRNA production, protein synthesis also declines after dactinomycin therapy. (From AMA Drug Evaluations Annual, 1993, p2015) [MeSH].", 
"A very toxic anthracycline aminoglycoside antineoplastic isolated from Streptomyces peucetius and others, used in treatment of LEUKEMIA and other NEOPLASMS [MeSH].", 
"Natural product isolated from Streptomyces pilosus. It forms iron complexes and is used as a chelating agent, particularly in the mesylate form [MeSH].", 
"Tetracycline which lacks the methyl substituent at position 7 and in which the hydrogen para- to the phenolic hydroxy group is substituted by chlorine. Like tetracycline, it is an antibiotic, but being excreted more slowly, effective blood levels are maintained for longer. It is used (mainly as the hydrochloride) for the treatment of Lyme disease, acne and bronchitis, as well as for hyponatraemia (low blood sodium concentration) due to the syndrome of inappropriate antidiuretic hormone (SIADH) where fluid restriction alone has been ineffective [ChEBI]. A TETRACYCLINE analog having a 7-chloro and a 6-methyl. Because it is excreted more slowly than TETRACYCLINE, it maintains effective blood levels for longer periods of time [MeSH].", 
"A topical bacteriostat that is available as various salts. It is used in wound dressings and mouth infections and may also have antifungal action, but may cause skin ulceration [MeSH].", 
"An anti-inflammatory 9-fluoro-glucocorticoid [MeSH].", "Carrier of aroma of butter, vinegar, coffee, and other foods [MeSH].", 
"A sulfhydryl reagent which oxidizes sulfhydryl groups to the disulfide form. It is a radiation-sensitizing agent of anoxic bacterial and mammalian cells [MeSH].", 
"The meso-isomer of 2,6-diaminopimelic acid [ChEBI].", "The meso-isomer of 2,6-diaminopimelic acid [ChEBI].", 
"An anthelmintic used primarily as the citrate in the treatment of filariasis, particularly infestations with Wucheria bancrofti or Loa loa [MeSH].", 
"A semi-synthetic aminoglycoside antibiotic that is used in the treatment of TUBERCULOSIS [MeSH].", 
"A chlorobenzene compound with two nitro substituents in the 2- and 4-positions [ChEBI]. A skin irritant that may cause dermatitis of both primary and allergic types. Contact sensitization with DNCB has been used as a measure of cellular immunity. DNCB is also used as a reagent for the detection and determination of pyridine compounds [MeSH].", 
"Antineoplastic antibiotic obtained from Streptomyces peucetius. It is a hydroxy derivative of DAUNORUBICIN [MeSH].", 
"Tetracycline in which the 5beta-hydrogen is replaced by a hydroxy group, while the 6alpha-hydroxy group is replaced by hydrogen. A semi-synthetic tetracycline antibiotic, it is used to inhibit bacterial protein synthesis and treat non-gonococcal urethritis and cervicitis, exacerbations of bronchitis in patients with chronic obstructive pulmonary disease (COPD), and adult periodontitis [ChEBI]. A synthetic tetracycline derivative with similar antimicrobial activity [MeSH].", 
"An optically inactive hexitol having meso-configuration [ChEBI]. A naturally occurring product of plants obtained following reduction of GALACTOSE. It appears as a white crystalline powder with a slight sweet taste. It may form in excess in the lens of the eye in GALACTOSEMIAS, a deficiency of GALACTOKINASE [MeSH].", 
"A chelating agent (CHELATING AGENTS) that sequesters a variety of polyvalent cations. It is used in pharmaceutical manufacturing and as a food additive [MeSH].", 
"A chelating agent relatively more specific for calcium and less toxic than EDETIC ACID [MeSH].", 
"An organic heterotetracyclic compound resulting from the formal dimerisation of gallic acid by oxidative aromatic coupling with intramolecular lactonisation of both carboxylic acid groups of the resulting biaryl. It is found in many fruits and vegetables, including raspberries, strawberries, cranberries, and pomegranates [ChEBI]. A fused four ring compound occurring free or combined in galls. Isolated from the kino of Eucalyptus maculata Hook and E. Hemipholia F. Muell. Activates Factor XII of the blood clotting system which also causes kinin release; used in research and as a dye [MeSH].", 
"A pyridoisoquinoline comprising emetam having methoxy substituents at the 6'-, 7'-, 10- and 11-positions [ChEBI]. The principal alkaloid of ipecac, from the ground roots of Uragoga (or Cephaelis) ipecacuanha or U. acuminata, of the Rubiaceae. It is used as an amebicide in many different preparations and may cause serious cardiac, hepatic, or renal damage and violent diarrhea and vomiting. Emetine inhibits protein synthesis in EUKARYOTIC CELLS but not PROKARYOTIC CELLS [MeSH].", 
"A member of the class of hydroxyanthraquinones that is 9,10-anthraquinone which is substituted by hydroxy groups at positions 1, 3, and 8 and by a methyl group at position 6. It is present in the roots and barks of numerous plants (particularly rhubarb and buckthorn), moulds, and lichens. It is an active ingredient of various Chinese herbs [ChEBI]. Purgative anthraquinone found in several plants, especially Rhamnus frangula. It was formerly used as a laxative, but is now used mainly as tool in toxicity studies [MeSH].", 
"The R-enantiomer of adrenaline [ChEBI]. The active sympathomimetic hormone from the ADRENAL MEDULLA. It stimulates both the alpha- and beta- adrenergic systems, causes systemic VASOCONSTRICTION and gastrointestinal relaxation, stimulates the HEART, and dilates BRONCHI and cerebral vessels. It is used in ASTHMA and CARDIAC FAILURE and to delay absorption of local ANESTHETICS [MeSH].", 
"The meso-diastereomer of butane-1,2,3,4-tetrol [ChEBI]. A four-carbon sugar that is found in algae, fungi, and lichens. It is twice as sweet as sucrose and can be used as a coronary vasodilator [MeSH].", 
"Any of several wide-spectrum macrolide antibiotics obtained from actinomycete Saccharopolyspora erythraea (formerly known as Streptomyces erythraeus) [ChEBI]. A bacteriostatic antibiotic macrolide produced by Streptomyces erythreus. Erythromycin A is considered its major active component. In sensitive organisms, it inhibits protein synthesis by binding to 50S ribosomal subunits. This binding process inhibits peptidyl transferase activity and interferes with translocation of amino acids during translation and assembly of proteins [MeSH].", 
"The 17beta-isomer of estradiol [ChEBI]. Generally refers to the 17-beta-isomer of estradiol, an aromatized C18 steroid with hydroxyl group at 3-beta- and 17-beta-position. Estradiol-17-beta is the most potent form of mammalian estrogenic steroids. In humans, it is produced primarily by the cyclic ovaries and the PLACENTA. It is also produced by the adipose tissue of men and postmenopausal women. The 17-alpha-isomer of estradiol binds weakly to estrogen receptors (RECEPTORS, ESTROGEN) and exhibits little estrogenic activity in estrogen-responsive tissues. Various isomers can be synthesized [MeSH].", 
"A second-line antitubercular agent that inhibits mycolic acid synthesis [MeSH].", 
"An S-ethylhomocysteine that has S-configuration at the chiral centre [ChEBI]. 2-Amino-4-(ethylthio)butyric acid. An antimetabolite and methionine antagonist that interferes with amino acid incorporation into proteins and with cellular ATP utilization. It also produces liver neoplasms [MeSH].", 
"A semisynthetic derivative of PODOPHYLLOTOXIN that exhibits antitumor activity. Etoposide inhibits DNA synthesis by forming a complex with topoisomerase II and DNA. This complex induces breaks in double stranded DNA and prevents repair by topoisomerase II binding. Accumulated breaks in DNA prevent entry into the mitotic phase of cell division, and lead to cell death. Etoposide acts primarily in the G2 and S phases of the cell cycle [MeSH].", 
"A pyrimidine 2'-deoxyribonucleoside compound having 5-fluorouracil as the nucleobase; used to treat hepatic metastases of gastrointestinal adenocarcinomas and for palliation in malignant neoplasms of the liver and gastrointestinal tract [ChEBI]. An antineoplastic antimetabolite that is metabolized to fluorouracil when administered by rapid injection; when administered by slow, continuous, intra-arterial infusion, it is converted to floxuridine monophosphate. It has been used to treat hepatic metastases of gastrointestinal adenocarcinomas and for palliation in malignant neoplasms of the liver and gastrointestinal tract [MeSH].", 
"A pyrimidine analog that is an antineoplastic antimetabolite. It interferes with DNA synthesis by blocking the THYMIDYLATE SYNTHETASE conversion of deoxyuridylic acid to thymidylic acid [MeSH].", 
"Folic acid is a form of the water-soluble vitamine B9. Its biologically active forms (tetrahydrofolate and others) are essential for nucleotide biosynthesis and homocysteine remethylation [ChEBI]. A member of the vitamin B family that stimulates the hematopoietic system. It is present in the liver and kidney and is found in mushrooms, spinach, yeast, green leaves, and grasses (POACEAE). Folic acid is used in the treatment and prevention of folate deficiencies and megaloblastic anemia [MeSH].", 
"A phosphonic acid having an (R,S)-1,2-epoxypropyl group attached to phosphorus [ChEBI]. An antibiotic produced by Streptomyces fradiae [MeSH].", 
"A monosaccharide in sweet fruits and honey that is soluble in water, alcohol, or ether. It is used as a preservative and an intravenous infusion in parenteral feeding [MeSH].", 
NA, "The pyranose form of L-fucose [ChEBI].", "A picolinic acid derivative isolated from various Fusarium species. It has been proposed for a variety of therapeutic applications but is primarily used as a research tool. Its mechanisms of action are poorly understood. It probably inhibits DOPAMINE BETA-HYDROXYLASE, the enzyme that converts dopamine to norepinephrine. It may also have other actions, including the inhibition of cell proliferation and DNA synthesis [MeSH].", 
"A steroid antibiotic that is isolated from the fermentation broth of Fusidium coccineum [ChEBI]. An antibiotic isolated from the fermentation broth of Fusidium coccineum. (From Merck Index, 11th ed). It acts by inhibiting translocation during protein synthesis [MeSH].", 
"An amino fatty acid composed of butanoic acid with the amino substituent located at C-4 [ChEBI]. The most common inhibitory neurotransmitter in the central nervous system [MeSH].", 
"An amino fatty acid composed of butanoic acid with the amino substituent located at C-4 [ChEBI]. The most common inhibitory neurotransmitter in the central nervous system [MeSH].", 
"The D-stereoisomer of galactosamine [ChEBI].", "A galactopyranose having D-configuration [ChEBI]. An aldohexose that occurs naturally in the D-form in lactose, cerebrosides, gangliosides, and mucoproteins. Deficiency of galactosyl-1-phosphate uridyltransferase (GALACTOSE-1-PHOSPHATE URIDYL-TRANSFERASE DEFICIENCY DISEASE) causes an error in galactose metabolism called GALACTOSEMIA, resulting in elevations of galactose in the blood [MeSH].", 
"A trihydroxybenzoic acid in which the hydroxy groups are at positions 3, 4, and 5 [ChEBI]. A colorless or slightly yellow crystalline compound obtained from nutgalls. It is used in photography, pharmaceuticals, and as an analytical reagent [MeSH].", 
"A family of gastrointestinal peptide hormones that excite the secretion of GASTRIC JUICE. They may also occur in the central nervous system where they are presumed to be neurotransmitters [MeSH].", 
"A product formed from skin, white connective tissue, or bone COLLAGEN. It is used as a protein food adjuvant, plasma substitute, hemostatic, suspending agent in pharmaceutical preparations, and in the manufacturing of capsules and suppositories [MeSH].", 
"Any of a group of aminoglycoside antibiotics produced by fermentation of some Micromonospora spp [ChEBI]. A complex of three different closely related aminoglycoside sulfates, Gentamicins C1, C2, and C1(subA), obtained from Micromonospora purpurea and related species. They are broad-spectrum antibiotics, but may cause ear and kidney damage. They act to inhibit protein synthesis (GENETIC TRANSLATION) [MeSH].", 
"A dye that is a mixture of violet rosanilinis with antibacterial, antifungal, and anthelmintic properties [MeSH].", 
"A 29-amino acid peptide hormone consisting of His, Ser, Gln, Gly, Thr, Phe, Thr, Ser, Asp, Tyr, Ser, Lys, Tyr, Leu, Asp, Ser, Arg, Arg, Ala, Gln, Asp, Phe, Val, Gln, Trp, Leu, Met, Asn and Thr residues joined in sequence [ChEBI]. A 29-amino acid pancreatic peptide derived from proglucagon which is also the precursor of intestinal GLUCAGON-LIKE PEPTIDES. Glucagon is secreted by PANCREATIC ALPHA CELLS and plays an important role in regulation of BLOOD GLUCOSE concentration, ketone metabolism, and several other biochemical and physiological processes. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1511) [MeSH].", 
"A sugar acid derived from D-glucose in which both the aldehydic carbon atom and the carbon atom bearing the primary hydroxyl group are oxidized to carboxylic acid groups [MeSH].", 
"An amino sugar whose structure comprises D-glucose having an amino substituent at position 2 [ChEBI].", 
"A glucopyranose having D-configuration [ChEBI]. A primary source of energy for living organisms. It is naturally occurring and is found in fruits and other parts of plants in its free state. It is used therapeutically in fluid and nutrient replacement [MeSH].", 
"A primary source of energy for living organisms. It is naturally occurring and is found in fruits and other parts of plants in its free state. It is used therapeutically in fluid and nutrient replacement [MeSH].", 
"An optically active form of glutamine having L-configuration [ChEBI]. A non-essential amino acid present abundantly throughout the body and is involved in many metabolic processes. It is synthesized from GLUTAMIC ACID and AMMONIA. It is the principal carrier of NITROGEN in the body and is an important energy source for many cells [MeSH].", 
"An optically active form of glutamine having L-configuration [ChEBI]. A non-essential amino acid present abundantly throughout the body and is involved in many metabolic processes. It is synthesized from GLUTAMIC ACID and AMMONIA. It is the principal carrier of NITROGEN in the body and is an important energy source for many cells [MeSH].", 
"An optically active form of glutamine having L-configuration [ChEBI]. A non-essential amino acid present abundantly throughout the body and is involved in many metabolic processes. It is synthesized from GLUTAMIC ACID and AMMONIA. It is the principal carrier of NITROGEN in the body and is an important energy source for many cells [MeSH].", 
"A tripeptide compound consisting of glutamic acid attached via its side chain to the N-terminus of cysteinylglycine [ChEBI]. A tripeptide with many roles in cells. It conjugates to drugs to make them more soluble for excretion, is a cofactor for some enzymes, is involved in protein disulfide bond rearrangement and reduces peroxides [MeSH].", 
"A tripeptide compound consisting of glutamic acid attached via its side chain to the N-terminus of cysteinylglycine [ChEBI]. A tripeptide with many roles in cells. It conjugates to drugs to make them more soluble for excretion, is a cofactor for some enzymes, is involved in protein disulfide bond rearrangement and reduces peroxides [MeSH].", 
"A tripeptide compound consisting of glutamic acid attached via its side chain to the N-terminus of cysteinylglycine [ChEBI]. A tripeptide with many roles in cells. It conjugates to drugs to make them more soluble for excretion, is a cofactor for some enzymes, is involved in protein disulfide bond rearrangement and reduces peroxides [MeSH].", 
"An triol that is propane substituted at positions 1, 2 and 3 by hydroxy groups [ChEBI]. A trihydroxy sugar alcohol that is an intermediate in carbohydrate and lipid metabolism. It is used as a solvent, emollient, pharmaceutical agent, and sweetening agent [MeSH].", 
"An triol that is propane substituted at positions 1, 2 and 3 by hydroxy groups [ChEBI]. A trihydroxy sugar alcohol that is an intermediate in carbohydrate and lipid metabolism. It is used as a solvent, emollient, pharmaceutical agent, and sweetening agent [MeSH].", 
"The simplest (and the only achiral) proteinogenic amino acid, with a hydrogen atom as its side chain [ChEBI]. A non-essential amino acid. It is found primarily in gelatin and silk fibroin and used therapeutically as a nutrient. It is also a fast inhibitory neurotransmitter [MeSH].", 
"The simplest (and the only achiral) proteinogenic amino acid, with a hydrogen atom as its side chain [ChEBI]. A non-essential amino acid. It is found primarily in gelatin and silk fibroin and used therapeutically as a nutrient. It is also a fast inhibitory neurotransmitter [MeSH].", 
"The simplest (and the only achiral) proteinogenic amino acid, with a hydrogen atom as its side chain [ChEBI]. A non-essential amino acid. It is found primarily in gelatin and silk fibroin and used therapeutically as a nutrient. It is also a fast inhibitory neurotransmitter [MeSH].", 
"A polydisperse, highly branched glucan composed of chains of D-glucopyranose residues in alpha(1->4) glycosidic linkage, joined together by alpha(1->6) glycosidic linkages. A small number of alpha(1->3) glycosidic linkages and some cumulative alpha(1->6) links also may occur. The branches in glycogen typically contain 8 to 12 glucose residues [ChEBI].", 
"A dimeric sesquiterpene found in cottonseed (GOSSYPIUM). The (-) isomer is active as a male contraceptive (CONTRACEPTIVE AGENTS, MALE) whereas toxic symptoms are associated with the (+) isomer [MeSH].", 
"A cytostatic triazole derivative which is not to be confused with guanazolo, the generic name for 8-azaguanine [MeSH].", 
"A 2-aminopurine carrying a 6-oxo substituent [ChEBI].", "A purine nucleoside in which guanine is attached to ribofuranose via a beta-N(9)-glycosidic bond [ChEBI]. A purine nucleoside that has guanine linked by its N9 nitrogen to the C1 carbon of ribose. It is a component of ribonucleic acid and its nucleotides play important roles in metabolism. (From Dorland, 28th ed) [MeSH].", 
"Chloro(7,12-diethenyl-3,8,13,17-tetramethyl-21H,23H-porphine-2,18-dipropanoato(4-)-N(21),N(22),N(23),N(24)) ferrate(2-) dihydrogen [MeSH].", 
"A chlorinated bisphenol antiseptic with a bacteriostatic action against Gram-positive organisms, but much less effective against Gram-negative organisms. It is mainly used in soaps and creams and is an ingredient of various preparations used for skin disorders. (From Martindale, The Extra Pharmacopoeia, 30th ed, p797) [MeSH].", 
"A hexamethyl-2,4,6-triamine derivative of 1,3,5-triazine [MeSH].", 
"A 1H-imidazol-4-yl group substituted at position C-4 by a 2-aminoethyl group [ChEBI]. An amine derived by enzymatic decarboxylation of HISTIDINE. It is a powerful stimulant of gastric secretion, a constrictor of bronchial smooth muscle, a vasodilator, and also a centrally acting neurotransmitter [MeSH].", 
"A 1H-imidazol-4-yl group substituted at position C-4 by a 2-aminoethyl group [ChEBI]. An amine derived by enzymatic decarboxylation of HISTIDINE. It is a powerful stimulant of gastric secretion, a constrictor of bronchial smooth muscle, a vasodilator, and also a centrally acting neurotransmitter [MeSH].", 
