"The L-enantiomer of homoserine [ChEBI].", "Cortisol is a corticosteroid hormone or glucocorticoid produced by zona fasciculata of the adrenal cortex, which is a part of the adrenal gland. It is usually referred to as the \\\\stress hormone\\\\ as it is involved in response to stress and anxiety, controlled by corticotropin-releasing hormone (CRH). It increases blood pressure and blood sugar, and reduces immune responses [ChEBI]. The main glucocorticoid secreted by the ADRENAL CORTEX. Its synthetic counterpart is used, either as an injection or topically, in the treatment of inflammation, allergy, collagen diseases, asthma, adrenocortical deficiency, shock, and some neoplastic conditions [MeSH].", 
"An antineoplastic agent that inhibits DNA synthesis through the inhibition of ribonucleoside diphosphate reductase [MeSH].", 
"Aminoglycoside produced by Streptomyces hygroscopicus. It is used as an anthelmintic against swine infections by large roundworms, nodular worms, and whipworms [MeSH].", 
"A purine nucleoside in which hypoxanthine is attached to ribofuranose via a beta-N(9)-glycosidic bond [ChEBI]. A purine nucleoside that has hypoxanthine linked by the N9 nitrogen to the C1 carbon of ribose. It is an intermediate in the degradation of purines and purine nucleosides to uric acid and in pathways of purine salvage. It also occurs in the anticodon of certain transfer RNA molecules. (Dorland, 28th ed) [MeSH].", 
"An inositol having myo- configuration [ChEBI]. An isomer of glucose that has traditionally been considered to be a B vitamin although it has an uncertain status as a vitamin and a deficiency syndrome has not been identified in man. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1379) Inositol phospholipids are important in signal transduction [MeSH].", 
"A peptide hormone produced in the pancreas and involved in regulating the metabolism of carbohydrates (particularly glucose) and fats. Commonly thought of as a protein, it consists of two petide chains, one containing 21 amino acid residues and the other containing 30; the chains are joined together by 2 disulfide bonds. Recombinant insulin is identical to human insulin, but is synthesised by inserting the human insulin gene into E. coli, which then produces insulin for human use. It is used in the treatment of type I and type II diabetes [ChEBI]. A 51-amino acid pancreatic hormone that plays a major role in the regulation of glucose metabolism, directly by suppressing endogenous glucose production (GLYCOGENOLYSIS; GLUCONEOGENESIS) and indirectly by suppressing GLUCAGON secretion and LIPOLYSIS. Native insulin is a globular protein comprised of a zinc-coordinated hexamer. Each insulin monomer containing two chains, A (21 residues) and B (30 residues), linked by two disulfide bonds. Insulin is used as a drug to control insulin-dependent diabetes mellitus (DIABETES MELLITUS, TYPE 1) [MeSH].", 
"A well-characterized basic peptide believed to be secreted by the liver and to circulate in the blood. It has growth-regulating, insulin-like, and mitogenic activities. This growth factor has a major, but not absolute, dependence on GROWTH HORMONE. It is believed to be mainly active in adults in contrast to INSULIN-LIKE GROWTH FACTOR II, which is a major fetal growth factor [MeSH].", 
"A soluble substance elaborated by antigen- or mitogen-stimulated T-LYMPHOCYTES which induces DNA synthesis in naive lymphocytes [MeSH].", 
"A starch found in the tubers and roots of many plants. Since it is hydrolyzable to FRUCTOSE, it is classified as a fructosan. It has been used in physiologic investigation for determination of the rate of glomerular function [MeSH].", 
"Chemical element with atomic number 53 [ChEBI]. A nonmetallic element of the halogen group that is represented by the atomic symbol I, atomic number 53, and atomic weight of 126.90. It is a nutritionally essential element, especially important in thyroid hormone synthesis. In solution, it has anti-infective properties and is used topically [MeSH].", 
"The L-enantiomer of isoleucine [ChEBI]. An essential branched-chain aliphatic amino acid found in many proteins. It is an isomer of LEUCINE. It is important in hemoglobin synthesis and regulation of blood sugar and energy levels [MeSH].", 
"The L-enantiomer of isoleucine [ChEBI]. An essential branched-chain aliphatic amino acid found in many proteins. It is an isomer of LEUCINE. It is important in hemoglobin synthesis and regulation of blood sugar and energy levels [MeSH].", 
"The L-enantiomer of isoleucine [ChEBI]. An essential branched-chain aliphatic amino acid found in many proteins. It is an isomer of LEUCINE. It is important in hemoglobin synthesis and regulation of blood sugar and energy levels [MeSH].", 
"Kanamycin is a naturally occurring antibiotic complex from Streptomyces kanamyceticus that consists of several components: kanamycin A, the major component (also usually designated as kanamycin), and kanamycins B, C, D and X the minor components [ChEBI]. Antibiotic complex produced by Streptomyces kanamyceticus from Japanese soil. Comprises 3 components: kanamycin A, the major component, and kanamycins B and C, the minor components [MeSH].", 
"An IBUPROFEN-type anti-inflammatory analgesic and antipyretic. It is used in the treatment of rheumatoid arthritis and osteoarthritis [MeSH].", 
"The L-enantiomer of leucine [ChEBI]. An essential branched-chain amino acid important for hemoglobin formation [MeSH].", 
"The L-enantiomer of leucine [ChEBI]. An essential branched-chain amino acid important for hemoglobin formation [MeSH].", 
"The L-enantiomer of leucine [ChEBI]. An essential branched-chain amino acid important for hemoglobin formation [MeSH].", 
"The amide resulting from the formal condensation of N,N-diethylglycine with 2,6-dimethylaniline [ChEBI]. A local anesthetic and cardiac depressant used as an antiarrhythmia agent. Its actions are more intense and its effects more prolonged than those of PROCAINE but its duration of action is shorter than that of BUPIVACAINE or PRILOCAINE [MeSH].", 
"An antibiotic produced by Streptomyces lincolnensis var. lincolnensis. It has been used in the treatment of staphylococcal, streptococcal, and Bacteroides fragilis infections [MeSH].", 
"The (R)-enantiomer of lipoic acid. A vitamin-like, C8 thia fatty acid with anti-oxidant properties [ChEBI]. An octanoic acid bridged with two sulfurs so that it is sometimes also called a pentanoic acid in some naming schemes. It is biosynthesized by cleavage of LINOLEIC ACID and is a coenzyme of oxoglutarate dehydrogenase (KETOGLUTARATE DEHYDROGENASE COMPLEX). It is used in DIETARY SUPPLEMENTS [MeSH].", 
"The (R)-enantiomer of lipoic acid. A vitamin-like, C8 thia fatty acid with anti-oxidant properties [ChEBI]. An octanoic acid bridged with two sulfurs so that it is sometimes also called a pentanoic acid in some naming schemes. It is biosynthesized by cleavage of LINOLEIC ACID and is a coenzyme of oxoglutarate dehydrogenase (KETOGLUTARATE DEHYDROGENASE COMPLEX). It is used in DIETARY SUPPLEMENTS [MeSH].", 
"An L-alpha-amino acid; the L-isomer of lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"The D-enantiomer of the alpha-amino acid lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"An L-alpha-amino acid; the L-isomer of lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"The D-enantiomer of the alpha-amino acid lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"An L-alpha-amino acid; the L-isomer of lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"Polysaccharides consisting of mannose units [MeSH].", "The D-enantiomer of mannitol [ChEBI]. A diuretic and renal diagnostic aid related to sorbitol. It has little significant energy value as it is largely eliminated from the body before any metabolism can take place. It can be used to treat oliguria associated with kidney failure or other manifestations of inadequate renal function and has been used for determination of glomerular filtration rate. Mannitol is also commonly used as a research tool in cell biological studies, usually to control osmolarity [MeSH].", 
"A hexose or fermentable monosaccharide and isomer of glucose from manna, the ash Fraxinus ornus and related plants. (From Grant & Hackh's Chemical Dictionary, 5th ed & Random House Unabridged Dictionary, 2d ed) [MeSH].", 
"A vesicant and necrotizing irritant destructive to mucous membranes. It was formerly used as a war gas. The hydrochloride is used as an antineoplastic in Hodgkin's disease and lymphomas. It causes severe gastrointestinal and bone marrow damage [MeSH].", 
"The L-enantiomer of methionine [ChEBI]. A sulfur containing essential amino acid that is important in many body functions. It is a chelating agent for heavy metals [MeSH].", 
"An optically active form of methionine having D-configuration [ChEBI]. A sulfur containing essential amino acid that is important in many body functions. It is a chelating agent for heavy metals [MeSH].", 
"The L-enantiomer of methionine [ChEBI]. A sulfur containing essential amino acid that is important in many body functions. It is a chelating agent for heavy metals [MeSH].", 
"The L-enantiomer of methionine [ChEBI]. A sulfur containing essential amino acid that is important in many body functions. It is a chelating agent for heavy metals [MeSH].", 
"An antineoplastic antimetabolite with immunosuppressant properties. It is an inhibitor of TETRAHYDROFOLATE DEHYDROGENASE and prevents the formation of tetrahydrofolate, necessary for synthesis of thymidylate, an essential component of DNA [MeSH].", 
"An alkylating agent in cancer therapy that may also act as a mutagen by interfering with and causing damage to DNA [MeSH].", 
"A tetracycline analogue having a dimethylamino group at position 7 and lacking the methyl and hydroxy groups at position 5 [ChEBI]. A TETRACYCLINE analog, having a 7-dimethylamino and lacking the 5 methyl and hydroxyl groups, which is effective against tetracycline-resistant STAPHYLOCOCCUS infections [MeSH].", 
"An anthracenedione-derived antineoplastic agent [MeSH].", "An oxacephem antibiotic [ChEBI]. Broad- spectrum beta-lactam antibiotic similar in structure to the CEPHALOSPORINS except for the substitution of an oxaazabicyclo moiety for the thiaazabicyclo moiety of certain CEPHALOSPORINS. It has been proposed especially for the meningitides because it passes the blood-brain barrier and for anaerobic infections [MeSH].", 
"A member of the class of 2-benzofurans that is 2-benzofuran-1(3H)-one which is substituted at positions 4, 5, 6, and 7 by methyl, methoxy, (2E)-5-carboxy-3-methylpent-2-en-1-yl, and hydroxy groups, respectively. It is an antibiotic produced by Penicillium brevi-compactum, P. stoloniferum, P. echinulatum and related species. An immunosuppressant, it is widely used (partiularly as its sodium salt and as the 2-(morpholin-4-yl)ethyl ester prodrug, mycophenolate mofetil) to prevent tissue rejection following organ transplants and for the treatment of certain autoimmune diseases [ChEBI]. An antibiotic substance derived from Penicillium stoloniferum, and related species. It blocks de novo biosynthesis of purine nucleotides by inhibition of the enzyme inosine monophosphate dehydrogenase. Mycophenolic acid is important because of its selective effects on the immune system. It prevents the proliferation of T-cells, lymphocytes, and the formation of antibodies from B-cells. It also may inhibit recruitment of leukocytes to inflammatory sites. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1301) [MeSH].", 
"The oxidised form of nicotinamide adenine dinucleotide found in all living cells. In metabolism, NAD(+) is involved in redox reactions, carrying electrons from one reaction to another [ChEBI]. A coenzyme composed of ribosylnicotinamide 5'-diphosphate coupled to adenosine 5'-phosphate by pyrophosphate linkage. It is found widely in nature and is involved in numerous enzymatic reactions in which it serves as an electron carrier by being alternately oxidized (NAD+) and reduced (NADH). (Dorland, 27th ed) [MeSH].", 
"A semi-synthetic antibiotic related to penicillin [MeSH].", 
"A monocarboxylic acid comprising 1,8-naphthyridin-4-one substituted by carboxylic acid, ethyl and methyl groups at positions 3, 1, and 7, respectively [ChEBI]. A synthetic 1,8-naphthyridine antimicrobial agent with a limited bacteriocidal spectrum. It is an inhibitor of the A subunit of bacterial DNA GYRASE [MeSH].", 
"A broad-spectrum highly toxic antibiotic or mixture of antibiotics produced by a streptomyces (Streptomyces fradiae) and used medically especially to treat local infections [ChEBI]. Antibiotic complex produced by Streptomyces fradiae. It is composed of neomycins A, B, and C. It acts by inhibiting translation during protein synthesis [MeSH].", 
"A pyridinemonocarboxylic acid in which the carboxy group is located at position 3 [ChEBI]. A water-soluble vitamin of the B complex occurring in various animal and plant tissues. It is required by the body for the formation of coenzymes NAD and NADP. It has PELLAGRA-curative, vasodilating, and antilipemic properties [MeSH].", 
"A pyridinecarboxamide in which the carboxamide group is located at position 3 [ChEBI]. An important compound functioning as a component of the coenzyme NAD. Its primary significance is in the prevention and/or cure of blacktongue and PELLAGRA. Most animals cannot manufacture this compound in amounts sufficient to prevent nutritional deficiency and it therefore must be supplemented through dietary intake [MeSH].", 
"An imidazolidine-2,4-dione that is hydantoin substituted at position 1 by a (5-nitro-2-furyl)methylene]amino group. An antibiotic that damages bacterial DNA [ChEBI]. A urinary anti-infective agent effective against most gram-positive and gram-negative organisms. Although sulfonamides and antibiotics are usually the agents of choice for urinary tract infections, nitrofurantoin is widely used for prophylaxis and long-term suppression [MeSH].", 
"A topical anti-infective agent effective against gram-negative and gram-positive bacteria. It is used for superficial WOUNDS AND INJURIES and skin infections. Nitrofurazone has also been administered orally in the treatment of TRYPANOSOMIASIS [MeSH].", 
"A potent lipoxygenase inhibitor that interferes with arachidonic acid metabolism. The compound also inhibits formyltetrahydrofolate synthetase, carboxylesterase, and cyclooxygenase to a lesser extent. It also serves as an antioxidant in fats and oils [MeSH].", 
"The R-enantiomer of noradrenaline [ChEBI]. Precursor of epinephrine that is secreted by the adrenal medulla and is a widespread central and autonomic neurotransmitter. Norepinephrine is the principal transmitter of most postganglionic sympathetic fibers and of the diffuse projection system in the brain arising from the locus ceruleus. It is also found in plants and is used pharmacologically as a sympathomimetic [MeSH].", 
"A synthetic fluoroquinolone with broad-spectrum antibacterial activity against most gram-negative and gram-positive bacteria. Norfloxacin is bactericidal and its mode of action depends on blocking of bacterial DNA replication by binding itself to an enzyme called DNA gyrase [ChEBI]. A synthetic fluoroquinolone (FLUOROQUINOLONES) with broad-spectrum antibacterial activity against most gram-negative and gram-positive bacteria. Norfloxacin inhibits bacterial DNA GYRASE [MeSH].", 
"An L-alpha-amino acid comprising hexanoic acid carrying an amino group at C-2. It does not occur naturally [ChEBI]. An unnatural amino acid that is used experimentally to study protein structure and function. It is structurally similar to METHIONINE, however it does not contain SULFUR [MeSH].", 
"An L-alpha-amino acid comprising hexanoic acid carrying an amino group at C-2. It does not occur naturally [ChEBI]. An unnatural amino acid that is used experimentally to study protein structure and function. It is structurally similar to METHIONINE, however it does not contain SULFUR [MeSH].", 
"Octopamine is a biogenic phenylethanolamine, which has been found to act as a neurotransmitter, neurohormone or neuromodulator in invertebrates [ChEBI]. An alpha-adrenergic sympathomimetic amine, biosynthesized from tyramine in the CNS and platelets and also in invertebrate nervous systems. It is used to treat hypotension and as a cardiotonic. The natural D(-) form is more potent than the L(+) form in producing cardiovascular adrenergic responses. It is also a neurotransmitter in some invertebrates [MeSH].", 
"A coumarin-derived antibiotic obtained from Streptomyces niveus [ChEBI]. An antibiotic compound derived from Streptomyces niveus. It has a chemical structure similar to coumarin. Novobiocin binds to DNA gyrase, and blocks adenosine triphosphatase (ATPase) activity. (From Reynolds, Martindale The Extra Pharmacopoeia, 30th ed, p189) [MeSH].", 
"Antibiotic macrolide produced by Streptomyces antibioticus [MeSH].", 
"A nitroimidazole antiprotozoal agent used in ameba and trichomonas infections. It is partially plasma-bound and also has radiation-sensitizing action [MeSH].", 
"An optically active form of ornithine having L-configuration [ChEBI]. An amino acid produced in the urea cycle by the splitting off of urea from arginine [MeSH].", 
"An optically active form of ornithine having L-configuration [ChEBI]. An amino acid produced in the urea cycle by the splitting off of urea from arginine [MeSH].", 
"An optically active form of ornithine having L-configuration [ChEBI]. An amino acid produced in the urea cycle by the splitting off of urea from arginine [MeSH].", 
"A pyrimidinemonocarboxylic acid that is uracil bearing a carboxy substituent at position C-6 [ChEBI].", 
"A tertiary amino compound which is the phenyl-o-tolylmethyl ether of 2-(dimethylamino)ethanol [ChEBI]. A muscarinic antagonist used to treat drug-induced parkinsonism and to relieve pain from muscle spasm [MeSH].", 
"A penicillin antibiotic carrying a 5-methyl-3-phenylisoxazole-4-carboxamide group at position 6 [ChEBI]. An antibiotic similar to FLUCLOXACILLIN used in resistant staphylococci infections [MeSH].", 
"A quinolinemonocarboxylic acid having the carboxy group at position 7 as well as oxo- and ethyl groups at positions 4 and 1 respectively and a dioxolo ring fused at the 5- and 6-positions [ChEBI]. Synthetic antimicrobial related to NALIDIXIC ACID and used in URINARY TRACT INFECTIONS [MeSH].", 
"A tetracycline used for treatment of infections caused by a variety of Gram positive and Gram negative microorganisms including Mycoplasma pneumoniae, Pasteurella pestis, Escherichia coli, Haemophilus influenzae (respiratory infections), and Diplococcus pneumoniae [ChEBI]. A TETRACYCLINE analog isolated from the actinomycete STREPTOMYCES rimosus and used in a wide variety of clinical conditions [MeSH].", 
"An aminobenzoic acid isomer that combines with pteridine and GLUTAMIC ACID to form FOLIC ACID. The fact that 4-aminobenzoic acid absorbs light throughout the UVB range has also resulted in its use as an ingredient in SUNSCREENS [MeSH].", 
"An aminobenzoic acid isomer that combines with pteridine and GLUTAMIC ACID to form FOLIC ACID. The fact that 4-aminobenzoic acid absorbs light throughout the UVB range has also resulted in its use as an ingredient in SUNSCREENS [MeSH].", 
"3-(p-Fluorophenyl)-alanine [MeSH].", "A pantothenic acid having R-configuration [ChEBI]. A butyryl-beta-alanine that can also be viewed as pantoic acid complexed with BETA ALANINE. It is incorporated into COENZYME A and protects cells against peroxidative damage by increasing the level of GLUTATHIONE [MeSH].", 
"A poisonous dipyridilium compound used as contact herbicide. Contact with concentrated solutions causes irritation of the skin, cracking and shedding of the nails, and delayed healing of cuts and wounds [MeSH].", 
"A polypeptide hormone (84 amino acid residues) secreted by the PARATHYROID GLANDS which performs the essential role of maintaining intracellular CALCIUM levels in the body. Parathyroid hormone increases intracellular calcium by promoting the release of CALCIUM from BONE, increases the intestinal absorption of calcium, increases the renal tubular reabsorption of calcium, and increases the renal excretion of phosphates [MeSH].", 
"An amino cyclitol glycoside that is the 1-O-(2-amino-2-deoxy-alpha-D-glucopyranoside) and the 3-O-(2,6-diamino-2,6-dideoxy-beta-L-idopyranosyl)-beta-D-ribofuranoside of 4,6-diamino-2,3-dihydroxycyclohexane (the 1R,2R,3S,4R,6S diastereoisomer). It is obtained from various Streptomyces species. A broad-spectrum antibiotic, it is used (generally as the sulfate salt) for the treatment of acute and chronic intestinal protozoal infections, but is not effective for extraintestinal protozoal infections. It is also used as a therapeutic against visceral leishmaniasis [ChEBI]. An oligosaccharide antibiotic produced by various STREPTOMYCES [MeSH].", 
"4-Hydroxy-4H-furo(3,2-c)pyran-2(6H)-one. A mycotoxin produced by several species of Aspergillus and Penicillium. It is found in unfermented apple and grape juice and field crops. It has antibiotic properties and has been shown to be carcinogenic and mutagenic and causes chromosome damage in biological systems [MeSH].", 
"A penicillin in which the substituent at position 6 of the penam ring is a phenylacetamido group [ChEBI]. A penicillin derivative commonly used in the form of its sodium or potassium salts in the treatment of a variety of infections. It is effective against most gram-positive bacteria and against gram-negative cocci. It has also been used as an experimental convulsant because of its actions on GAMMA-AMINOBUTYRIC ACID mediated synaptic transmission [MeSH].", 
"An insecticide and herbicide that has also been used as a wood preservative. Pentachlorphenol is a widespread environmental pollutant. Both chronic and acute pentachlorophenol poisoning are medical concerns. The range of its biological actions is still being actively explored, but it is clearly a potent enzyme inhibitor and has been used as such as an experimental tool [MeSH].", 
"An organosulfonate salt obtained by reaction of pentamidine with two equivalents of 2-hydroxyethylsulfonic acid [ChEBI]. Antiprotozoal agent effective in trypanosomiasis, leishmaniasis, and some fungal infections; used in treatment of PNEUMOCYSTIS pneumonia in HIV-infected patients. It may cause diabetes mellitus, central nervous system damage, and other toxic effects [MeSH].", 
"The L-enantiomer of phenylalanine [ChEBI]. An essential aromatic amino acid that is a precursor of MELANIN; DOPAMINE; noradrenalin (NOREPINEPHRINE), and THYROXINE [MeSH].", 
"The L-enantiomer of phenylalanine [ChEBI]. An essential aromatic amino acid that is a precursor of MELANIN; DOPAMINE; noradrenalin (NOREPINEPHRINE), and THYROXINE [MeSH].", 
"The L-enantiomer of phenylalanine [ChEBI]. An essential aromatic amino acid that is a precursor of MELANIN; DOPAMINE; noradrenalin (NOREPINEPHRINE), and THYROXINE [MeSH].", 
"Water-soluble, copper-containing low molecular weight polypeptides obtained from the culture medium of Streptomyces verticillus. They are specific inhibitors of DNA synthesis in bacteria and have been found to act as antitumor agents. They have also been used against rust fungi of plants [MeSH].", 
"A phosphoamino acid consisting of creatine having a phospho group attached at the primary nitrogen of the guanidino group [ChEBI]. An endogenous substance found mainly in skeletal muscle of vertebrates. It has been tried in the treatment of cardiac disorders and has been added to cardioplegic solutions. (Reynolds JEF(Ed): Martindale: The Extra Pharmacopoeia (electronic version). Micromedex, Inc, Englewood, CO, 1996) [MeSH].", 
"The phosphate of choline; and the parent compound of the phosphocholine family [ChEBI]. Calcium and magnesium salts used therapeutically in hepatobiliary dysfunction [MeSH].", 
"The phosphate of choline; and the parent compound of the phosphocholine family [ChEBI]. Calcium and magnesium salts used therapeutically in hepatobiliary dysfunction [MeSH].", 
"A myo-inositol hexakisphosphate in which each hydroxy group of myo-inositol is monophosphorylated [ChEBI]. Complexing agent for removal of traces of heavy metal ions. It acts also as a hypocalcemic agent [MeSH].", 
"Antimicrobial against Gram negative and some Gram positive bacteria. It is protein bound and concentrated in bile and urine and used for gastrointestinal, biliary, and urinary infections [MeSH].", 
"Semisynthetic, broad-spectrum, AMPICILLIN derived ureidopenicillin antibiotic proposed for PSEUDOMONAS infections. It is also used in combination with other antibiotics [MeSH].", 
"An antineoplastic agent that acts by alkylation [MeSH].", "A lignan (LIGNANS) found in PODOPHYLLIN resin from the roots of PODOPHYLLUM plants. It is a potent spindle poison, toxic if taken internally, and has been used as a cathartic. It is very irritating to skin and mucous membranes, has keratolytic actions, has been used to treat warts and keratoses, and may have antineoplastic properties, as do some of its congeners and derivatives [MeSH].", 
"A polymyxin having a (6R)-6-methyloctanoyl group at the amino terminus [ChEBI]. A mixture of polymyxins B1 and B2, obtained from Bacillus polymyxa strains. They are basic polypeptides of about eight amino acids and have cationic detergent action on cell membranes. Polymyxin B is used for infections with gram-negative organisms, but may be neurotoxic and nephrotoxic [MeSH].", 
"A polymer composed of PEG-ylated sorbitan, where the total number of poly(ethylene glycol) units is 20 (w + x + y + z = 20) and a single terminal is capped by an oleoyl group [ChEBI]. Sorbitan mono-9-octadecanoate poly(oxy-1,2-ethanediyl) derivatives; complex mixtures of polyoxyethylene ethers used as emulsifiers or dispersing agents in pharmaceuticals [MeSH].", 
"A polymer composed of PEG-ylated sorbitan, where the total number of poly(ethylene glycol) units is 20 (w + x + y + z = 20) and a single terminal is capped by a dodecanoyl group [ChEBI]. Sorbitan mono-9-octadecanoate poly(oxy-1,2-ethanediyl) derivatives; complex mixtures of polyoxyethylene ethers used as emulsifiers or dispersing agents in pharmaceuticals [MeSH].", 
