"A substituted phenothiazine in which the ring nitrogen at position 10 is attached to C-3 of an N,N-dimethylpropan-2-amine moiety [ChEBI]. A phenothiazine derivative with histamine H1-blocking, antimuscarinic, and sedative properties. It is used as an antiallergic, in pruritus, for motion sickness and sedation, and also in animals [MeSH].", 
"A widely used non-cardioselective beta-adrenergic antagonist. Propranolol has been used for MYOCARDIAL INFARCTION; ARRHYTHMIA; ANGINA PECTORIS; HYPERTENSION; HYPERTHYROIDISM; MIGRAINE; PHEOCHROMOCYTOMA; and ANXIETY but adverse effects instigate replacement by newer drugs [MeSH].", 
"A group of simple proteins that yield basic amino acids on hydrolysis and that occur combined with nucleic acid in the sperm of fish. Protamines contain very few kinds of amino acids. Protamine sulfate combines with heparin to form a stable inactive complex; it is used to neutralize the anticoagulant action of heparin in the treatment of heparin overdose. (From Merck Index, 11th ed; Martindale, The Extra Pharmacopoeia, 30th ed, p692) [MeSH].", 
"An aminonucleoside antibiotic, derived from the Streptomyces alboniger bacterium, that causes premature chain termination during translation taking place in the ribosome [ChEBI]. A cinnamamido ADENOSINE found in STREPTOMYCES alboniger. It inhibits protein synthesis by binding to RNA. It is an antineoplastic and antitrypanosomal agent and is used in research as an inhibitor of protein synthesis [MeSH].", 
"A four-carbon alkane-alpha,omega-diamine [ChEBI]. A toxic diamine formed by putrefaction from the decarboxylation of arginine and ornithine [MeSH].", 
