"The nitrogen oxoanion formed by loss of a proton from nitrous acid [ChEBI]. Nitrous acid sodium salt. Used in many industrial processes, in meat curing, coloring, and preserving, and as a reagent in ANALYTICAL CHEMISTRY TECHNIQUES. It is used therapeutically as an antidote in cyanide poisoning. The compound is toxic and mutagenic and will react in vivo with secondary or tertiary amines thereby producing highly carcinogenic nitrosamines [MeSH].", 
