"A clear, odorless, tasteless liquid that is essential for most animal and plant life and is an excellent solvent for many substances. The chemical formula is hydrogen oxide (H2O). (McGraw-Hill Dictionary of Scientific and Technical Terms, 4th ed) [MeSH].", 
"A pentitol (five-carbon sugar alcohol) having meso-configuration, being derived from xylose by reduction of the carbonyl group [ChEBI]. A five-carbon sugar alcohol derived from XYLOSE by reduction of the carbonyl group. It is as sweet as sucrose and used as a noncariogenic sweetener [MeSH].", 
"An aldopentose, found in the embryos of most edible plants and used in medicine to test for malabsorption by administration in water to the patient [ChEBI].", 
"A reagent used for the determination of iron [MeSH].", "A vitamin antagonist which has teratogenic effects [MeSH].", 
"An antimetabolite antineoplastic agent with immunosuppressant properties. It interferes with nucleic acid synthesis by inhibiting purine metabolism and is used, usually in combination with other drugs, in the treatment of or in remission maintenance programs for leukemia [MeSH].", 
"An antiseptic with mild fungistatic, bacteriostatic, anthelmintic, and amebicidal action. It is also used as a reagent and metal chelator, as a carrier for radio-indium for diagnostic purposes, and its halogenated derivatives are used in addition as topical anti-infective agents and oral antiamebics [MeSH].", 
"A synthetic fluoroquinolone antibacterial agent that inhibits the supercoiling activity of bacterial DNA gyrase, halting DNA replication [ChEBI]. A synthetic fluoroquinolone (FLUOROQUINOLONES) antibacterial agent that inhibits the supercoiling activity of bacterial DNA GYRASE, halting DNA REPLICATION [MeSH].", 
"An anthracycline produced by Streptomyces galilaeus. It has potent antineoplastic activity [MeSH].", 
"A cephalosporin antibiotic [ChEBI]. A semisynthetic cephamycin antibiotic with a broad spectrum of activity against both gram-positive and gram-negative microorganisms. It has a high rate of efficacy in many types of infection and to date no severe side effects have been noted [MeSH].", 
"A 1,4-dihydro-1,8-naphthyridine with an ethyl group at the 1 position, a carboxy group at the 3-position, an oxo sustituent at the 4-position, a fluoro substituent at the 5-position and a piperazin-1-yl group at the 7 position. An antibacterial, it is used in the treatment of urinary-tract infections and gonorrhoea [ChEBI]. A broad-spectrum 6-fluoronaphthyridinone antibacterial agent (FLUOROQUINOLONES) structurally related to NALIDIXIC ACID [MeSH].", 
"Antineoplastic agent especially effective against malignant brain tumors. The resistance which brain tumor cells acquire to the initial effectiveness of this drug can be partially overcome by the simultaneous use of membrane-modifying agents such as reserpine, calcium antagonists such as nicardipine or verapamil, or the calmodulin inhibitor, trifluoperazine. The drug has also been used in combination with other antineoplastic agents or with radiotherapy for the treatment of various neoplasms [MeSH].", 
"A macrolide antibiotic from Streptomyces narbonensis. The drug has antimicrobial activity against a wide spectrum of pathogens [MeSH].", 
"A macrolide antibiotic produced by Streptomyces ambofaciens. The drug is effective against gram-positive aerobic pathogens, N. gonorrhoeae, and staphylococci. It is used to treat infections caused by bacteria and Toxoplasma gondii [MeSH].", 
"Magnesium chloride. An inorganic compound consisting of one magnesium and two chloride ions. The compound is used in medicine as a source of magnesium ions, which are essential for many cellular activities. It has also been used as a cathartic and in alloys [MeSH].", 
"Macrolide antibiotic obtained from cultures of Streptomyces fradiae. The drug is effective against many microorganisms in animals but not in humans [MeSH].", 
"Nocodazole is an antineoplastic agent which exerts its effect by depolymerizing microtubules [MeSH].", 
"An aromatic amine that is pyridine bearing a single amino substituent at position 4. An orphan drug in the US, it is used to improve walking in adults with multiple sclerosis [ChEBI]. One of the POTASSIUM CHANNEL BLOCKERS, with secondary effect on calcium currents, which is used mainly as a research tool and to characterize channel subtypes [MeSH].", 
"A cytokine that stimulates the growth and differentiation of B-LYMPHOCYTES and is also a growth factor for HYBRIDOMAS and plasmacytomas. It is produced by many different cells including T-LYMPHOCYTES; MONOCYTES; and FIBROBLASTS [MeSH].", 
"An organoplatinum compound that possesses antineoplastic activity [MeSH].", 
"A member of the CXC chemokine family that plays a role in the regulation of the acute inflammatory response. It is secreted by variety of cell types and induces CHEMOTAXIS of NEUTROPHILS and other inflammatory cells [MeSH].", 
"An antineoplastic antibiotic produced by Streptomyces caespitosus. It is one of the bi- or tri-functional ALKYLATING AGENTS causing cross-linking of DNA and inhibition of DNA synthesis [MeSH].", 
"A pyrrolizidine alkaloid and a toxic plant constituent that poisons livestock and humans through the ingestion of contaminated grains and other foods. The alkaloid causes pulmonary artery hypertension, right ventricular hypertrophy, and pathological changes in the pulmonary vasculature. Significant attenuation of the cardiopulmonary changes are noted after oral magnesium treatment [MeSH].", 
"A nitroimidazole that sensitizes hypoxic tumor cells that are normally resistant to radiation therapy [MeSH].", 
"A metabolite of tryptophan with a possible role in neurodegenerative disorders. Elevated CSF levels of quinolinic acid are correlated with the severity of neuropsychological deficits in patients who have AIDS [MeSH].", 
"A metal chloride salt with a Li(+) counterion [ChEBI]. A salt of lithium that has been used experimentally as an immunomodulator [MeSH].", 
