"A dinitrophenol having the nitro groups at the 2- and 4-positions [ChEBI]. A toxic dye, chemically related to trinitrophenol (picric acid), used in biochemical studies of oxidative processes where it uncouples oxidative phosphorylation. It is also used as a metabolic stimulant. (Stedman, 26th ed) [MeSH].", 
"A glucopyranose ring with a phosphate replacing the hydroxy in the hydroxymethyl group at position 6 [ChEBI]. An ester of glucose with phosphoric acid, made in the course of glucose metabolism by mammalian and other cells. It is a normal constituent of resting muscle and probably is in constant equilibrium with fructose-6-phosphate. (Stedman, 26th ed) [MeSH].", 
"A non-metabolizable glucose analogue that is not phosphorylated by hexokinase. 3-O-Methylglucose is used as a marker to assess glucose transport by evaluating its uptake within various cells and organ systems. (J Neurochem 1993;60(4):1498-504) [MeSH].", 
"A simple monocarboxylic acid containing two carbons [ChEBI]. Product of the oxidation of ethanol and of the destructive distillation of wood. It is used locally, occasionally internally, as a counterirritant and also as a reagent. (Stedman, 26th ed) [MeSH].", 
