"A 1,2-glycol compound produced via reaction of ethylene oxide with water [ChEBI]. A colorless, odorless, viscous dihydroxy alcohol. It has a sweet taste, but is poisonous if ingested. Ethylene glycol is the most important glycol commercially available and is manufactured on a large scale in the United States. It is used as an antifreeze and coolant, in hydraulic fluids, and in the manufacture of low-freezing dynamites and resins [MeSH].", 
